import { useSelector } from "react-redux";
import CartItem from "../components/CartItem";

const Cart = () => {

  const items = useSelector((state) => state.cart_items)
  return <div>
    {
      items.map((item) => (
        <CartItem item = {item}/>
      ))
    }
  </div>;
};

export default Cart;
